Low round count GEN 3 Glock 20 SF (short frame) 10mm with the following extras:
Lone wolf barrel that allows shooting lead and is more accurate and has much better chamber support than factory barrel.  Lone wolf barrel has been 100% reliable.  Factory barrel is included and has only been used once.  
4 15-round magazines.
Heinie steel target sights installed.
Grip sleeve installed.
Grip plug installed.
Glock brand (OEM) 3.5 pound connector installed (can’t find the original heavy connector, sorry).
Stainless steel recoil guide rod with a 21 pound spring installed—has been 100% reliable with light and heavy loads, and helps protect the frame when shooting heavy loads.  Factory plastic guide rod and spring are included.
Factory box and all the tools/paperwork.
Lots of reloading supplies; 
about 200 rounds of new brass, some primed; 
about 150 used brass; some loaded with handloads (I’d be happy to shoot all the ammo if you’re afraid to)—load and number of loadings is recorded and included; 
plastic ammo boxes for all the ammo; 
about 200 bullets, FMJ, hard cast that the gun likes, and some plated; 
mostly full box of Double Tap 230 grain hardcast ammo that is great to carry for bear protection; 
Lee carbide reloading dies with the factory crimp die (dies also work for reloading 40 S&W).

Face to Face in Missoula to a Montana resident only.  Must sign a bill of sale, and I’ll do the same.  This is a package deal and the price is firm.  No trades.
